import {combineReducers} from 'redux';
import products from './products';
import product from './product';
import tasks from './addtasks';
import count from './count';
const appReducers=combineReducers({
    products:products,
    product:product,
    tasks:tasks,
  //  count:count
})
export default appReducers;
